window.bookSummaryJSON = "<p><b>One spy. One dangerous book. One deadly mission. Discover the first book in this gripping fantasy mystery series – </b><b><i>The Invisible Library</i></b><b> is the astounding debut from bestselling author Genevieve Cogman.<br> <br> Perfect for fans of </b><b><i>Mr Penumbra's 24-Hour Bookstore</i></b><b> by Robin Sloan, Jasper Fforde's </b><b><i>The Eyre Affair</i></b><b> or Ben Aaronovitch's </b><b><i>Rivers of London</i></b><b>.<br> <br> 'I absolutely loved this' – N.K. Jemisin, author of </b><b><i>The Fifth Season</i></b><br> <br> Irene is a professional spy for the mysterious Library, whose staff are sent to different realities to harvest dangerous and mystical fiction.<br> <br> Irene has been posted to an alternative steampunk London along with her enigmatic new assistant, Kai. Their mission: to retrieve a dangerous edition of <i>Grimms' Fairy Tales</i>. But it has already been stolen.<br> <br> In London's underground, the laws of nature have been bent – supernatural creatures and unpredictable magic stalk the land. The city is home to vampires, werewolves – factions that are all prepared to fight to the death for this book.<br> <br> Irene must face a web of deadly danger, deception and secret societies. Her new assistant is hiding secrets of his own. Yet failure is not an option – the nature of reality itself is at stake . . .<br> <br> <b>Continue the journey with the adventurous second title in the Invisible Library series, The Masked City.<br> <br> </b></p>"; 
